import React, { useState } from 'react';
import { Calendar, momentLocalizer } from 'react-big-calendar';
import { addHours } from 'date-fns';
import 'react-big-calendar/lib/css/react-big-calendar.css';
import { parseISO } from 'date-fns';
import { dateFnsLocalizer } from 'react-big-calendar';
import { format, parse, startOfWeek, getDay } from 'date-fns';

// Mock events
const events = [
	{
		id: 0,
		title: 'Sprint Planning',
		start: parseISO('2025-06-16T09:15:00'),
		end: parseISO('2025-06-16T10:00:00'),
		platform: 'Zoom',
		zapyInvited: true,
	},
	{
		id: 1,
		title: 'Lunch Time',
		start: parseISO('2025-06-16T12:00:00'),
		end: parseISO('2025-06-16T13:00:00'),
		platform: '',
		zapyInvited: false,
	},
	{
		id: 2,
		title: 'Android Sprint Planning',
		start: parseISO('2025-06-16T15:30:00'),
		end: parseISO('2025-06-16T16:30:00'),
		platform: 'Google Meet',
		zapyInvited: true,
	},
	{
		id: 3,
		title: 'Refinement Messaging',
		start: parseISO('2025-06-19T13:00:00'),
		end: parseISO('2025-06-19T13:50:00'),
		platform: 'Teams',
		zapyInvited: false,
	},
	// ...add more events as needed
];

const locales = {
	'en-US': require('date-fns/locale/en-US'),
};

const localizer = dateFnsLocalizer({
	format,
	parse,
	startOfWeek,
	getDay,
	locales,
});

export default function VoiceAssistant() {
	const [selectedEvent, setSelectedEvent] = useState(null);
	const [joinMsg, setJoinMsg] = useState('');

	return (
		<div className="min-h-screen bg-black flex flex-col items-center py-10 px-2">
			<div className="w-full max-w-6xl">
				<h1 className="text-3xl font-bold mb-6 text-white text-center">
					AI Voice Assistant
				</h1>
				<div className="bg-white rounded-xl shadow p-6 mb-8">
					<h2 className="text-xl font-semibold mb-4 text-blue-700">
						Google Calendar View (Mock)
					</h2>
					<Calendar
						localizer={localizer}
						events={events}
						startAccessor="start"
						endAccessor="end"
						style={{ height: 500 }}
						onSelectEvent={(event) => setSelectedEvent(event)}
						eventPropGetter={(event) => ({
							style: {
								backgroundColor: event.zapyInvited ? '#bbf7d0' : '#fef08a',
								color: '#222',
								borderRadius: '6px',
								border: event.zapyInvited
									? '2px solid #22c55e'
									: '2px solid #eab308',
							},
						})}
					/>
				</div>
				{selectedEvent && (
					<div className="bg-white rounded-xl shadow p-6 mb-8">
						<h3 className="text-lg font-semibold mb-2">
							{selectedEvent.title}
						</h3>
						<div className="mb-2">
							<span className="text-gray-700">
								Platform: {selectedEvent.platform || 'N/A'}
							</span>
						</div>
						<div className="mb-2">
							<span className="text-gray-700">
								Start: {selectedEvent.start.toLocaleString()}
							</span>
						</div>
						<div className="mb-2">
							<span className="text-gray-700">
								End: {selectedEvent.end.toLocaleString()}
							</span>
						</div>
						<div>
							{selectedEvent.zapyInvited ? (
								<span className="inline-block bg-green-100 text-green-700 px-2 py-1 rounded">
									Zapy AI Voice Assistant Invited
								</span>
							) : (
								<span className="inline-block bg-yellow-100 text-yellow-700 px-2 py-1 rounded">
									Zapy AI Voice Assistant Not Added
								</span>
							)}
						</div>
						<button
							className="mt-4 bg-blue-600 text-white px-4 py-2 rounded shadow hover:bg-blue-700 transition"
							onClick={() =>
								setJoinMsg(
									`Joining "${selectedEvent.title}" on ${selectedEvent.platform} with Zapy AI Voice Assistant!`
								)
							}
						>
							Join with Zapy AI Voice Assistant
						</button>
						{joinMsg && (
							<div className="mt-4 text-green-700 font-semibold">
								{joinMsg}
							</div>
						)}
					</div>
				)}
			</div>
		</div>
	);
}
